import React from 'react';
import styled from 'styled-components';

const ActivitiesDiv =styled.div`
    width:100%;
    height:15%;
    position:flex;
    background: white;
    border-radius:16px;
    box-shadow: 5px 10px 5px 5px gray;
`;

const Activities =({imgsrc,description})=>{
    return(
      <ActivitiesDiv>
          <img src={imgsrc} style={{width:'25%',height:'25%'}}/>
      </ActivitiesDiv>
    );
};
export default Activities;
